import React from 'react';
import styled from "styled-components";

const SDiv = styled.div`
  background: #F6F6F6;
  margin: 0 auto;
`;
const Box = styled.div`
  margin-left: 50px;
  margin-right: 50px;
`
const TopBar = styled.div`
  width: 100%;
  height: 82px;
  background: #FFFFFF;
  flex-shrink: 0;
  margin-bottom: 26px;
`;
const Container = styled.div`
  display: flex;
  background: #FFFFFF;
  width: ${(props) => (props.width !== undefined ? `${props.width}px` : '100%')};
  height: ${(props) => props.height}px;
  margin-left: ${(props) => (props.left !== undefined ? `${props.left}px` : 0)};
  margin-right: ${(props) => (props.right !== undefined ? `${props.right}px` : 0)};
  margin-top: ${(props) => (props.top !== undefined ? `${props.top}px` : 0)};
  margin-bottom: ${(props) => (props.bottom !== undefined ? `${props.bottom}px` : 0)};
  // margin: 0 auto;
  border-radius: 4px;
  justify-content: center;
  align-items: center;
  border-radius: 4px;
`;
const Content1 = styled.div`
  font-size: 20px;
  font-style: normal;
  font-weight: 400;
  line-height: 140%;
  font-family: 'NotoSansKR';
`;
const Title = styled.h4`
font-family: 'NotoSansKR'
font-size: 24px;
font-style: normal;
font-weight: 700;
line-height: 140%;
`;

const Column1 = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
`;
const Row1 = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: start;
  margin-bottom: 15px;
  margin-right: ${(props) => (props.left !== undefined ? `${props.left}px` : 0)};
`;

function Home() {
  const currentDate = new Date();
const month = currentDate.getMonth() + 1; 
const date = currentDate.getDate();

const todaysDate = `${month}월 ${date}일`;
  return (
    <SDiv>
      <TopBar>
        최현종 님
      </TopBar>
    <Box>
    <h3 style={{ textAlign: 'right' }}>{todaysDate}</h3>
    <Container  height={83} bottom={35}>
    <svg xmlns="http://www.w3.org/2000/svg" width="40" height="40" viewBox="0 0 40 40" fill="none">
      <path d="M22.6667 12.9405H10.2222C8.26669 12.9405 6.66669 14.3523 6.66669 16.0778V22.3523C6.66669 24.0778 8.26669 25.4895 10.2222 25.4895H12V30.1954C12 31.9209 13.6 33.3327 15.5556 33.3327H19.1111V25.4895H22.6667L29.7778 31.7641H33.3334V6.66602H29.7778L22.6667 12.9405Z" fill="#0079E0"/>
    </svg>
    <Content1>아아 여러분 이것은 공지입니다. 답변할때 유의하세요. 최대 몇자까지 적을 수 있냐면 그건 이제 잘..</Content1>
    </Container>
    <Row1>
      <Column1>
      <Title>건의/문의 처리율</Title>
      <Container width={250} height={315} top={14} right={26} bottom={35}></Container>
      </Column1>
      <Column1>
      <Title>최근 올라온 건의/문의</Title>
      <Container width={870} height={315} top={14} bottom={35}></Container>
      </Column1>
    </Row1>
    <Row1>
    <Column1>
      <Title>방문자 추이</Title>
      <Container width={555} height={252} top={14} right={25} bottom={182}></Container>
      </Column1>
      <Column1>
      <Title>고정 공지글 조회수</Title>
      <Container width={560} height={252} top={14} bottom={182}></Container>
      </Column1>
    </Row1>
    </Box>
    </SDiv>
  );
}

export default Home;
